import React, { useEffect, useState} from 'react'
import Footer from './components/Footer'
import Cookies from 'js-cookie'

const Contacts = () => {

    const [contactItem, setContactItem] = useState({items:[]})
    const [query, setQuery] = useState()



    useEffect(()=>{
        // setCookies(Cookies.get('token'))
        console.log(Cookies.get('token'))
        fetch('http://localhost:5000/read-contacts',{
            method: 'GET',
            mode: 'cors',
            headers: {
                'Content-Type': 'application/x-www-form-urlencoded',
                'Access-Control-Allow-Origin': '*',
                'x-access-token': Cookies.get('token')
            }

        }).then(resp => resp.json())
        .then(items => {
            setContactItem({items:[Object.values(items.contacts)]})
        })

    }, [query])




    const newContactList = contactItem.items.map(function(mObject, i){
        return console.log(mObject.values.id)
    })

    return(

        <div className='app-bg'>
            <h3 className='title'>Contacts</h3>
            <ul>
               {newContactList}
            </ul>


        <Footer />
        </div>
    )
}

export default Contacts;
